def reduce(data):
    # set pos to start of string
    idx = 0
    # while there is still chars to scan
    data_length = len(data)
    while idx < data_length - 1:
        # get current char
        c1 = ord(data[idx])
        # get next char
        c2 = ord(data[idx+1])
        # if char cases are different
        if abs(c1 - c2) == 32:
            # remove both chars
            res = data[:idx] + data[idx+2:]
            # and fallback to previous char
            if idx > 0:
                idx -= 1
            data = res
            data_length = len(data)
        else:
            # otherwise next pos
            idx += 1
    return data

data = ""
best_score = len(reduce(data))
best_candidate = ''

for i in range(0, 26):
    candidate = chr(ord('a') + i)
    candidate_upper_case = chr(ord('A') + i)
    line = data.replace(candidate, '')
    line = line.replace(candidate_upper_case, '')
    score = len(reduce(line))
    if score < best_score:
        best_score = score
        best_candidate = candidate
    print('candidate : %s, result : %s' % (candidate, score))

print('best candidate : %s, result : %s' % (best_candidate, best_score))
